(104, 'app_wellcome_description', 'Al Sistema Administrativo Sala Situacional, adscrita a la Universidad Bolivariana de Venezuela (UBV Sede Zulia), un espacio de análisis permanente donde se emplean las herramientas tecnológicas apropiadas para gestionar los datos académicos, administrativos y la participación de los diferentes sectores, por esa variación dinámica, en el ámbito social se planteó la necesidad de adaptarse a las nuevas transformaciones del entorno tecnológico de manera inmediata. La innovación, la rapidez, el servicio de gran calidad, el ritmo al que se mejora y aplica el conocimiento constituyen las nuevas reglas del juego. En el mundo de hoy, la dedicación y la aportación de fuerza laboral son decisivas y la información es el arma esencial en esta batalla.', 'yes'),
