(13, 13, 'doc_tag', '', 0, 0),
(14, 14, 'about', '<p><strong>Visión</strong>: Constituirse en un espacio con herramienta de pensamiento y acción para el apoyo, seguimiento y control a los procesos de decisión, para fortalecer la gestión de gobierno dentro del MPPE. Asegura un correcto uso de la información considerada como neurálgica o estratégica.</p>\n	<p><strong>Misión</strong>: Asumir la instancia, virtual o real, para la articulación del análisis estratégico y coyuntural, en donde convergen, en forma matricial, diferentes saberes para la identificación de las necesidades sociales de los grupos humanos, conociendo los factores que la determinan, evaluando las intervenciones viables y factibles de acuerdo al contexto local, monitoreando los resultados obtenidos después de la operacionalización de las decisiones tomadas.</p>\n<p><strong>Objetivos:</strong>&nbsp;Fortalecer las condiciones tecnológicas del Ambiente Virtual de Aprendizaje e Investigación de la Dirección Socio Académica en la Universidad Bolivariana de Venezuela. Ejes Zulia Trujillo, mediante el acceso y uso de recursos tecnológicos y didácticos para fortalecer los procesos de aprendizaje integral e investigación científica del personal docente, estudiantes de sede y municipalizados y las comunidades que interactúan con la universidad a través de sus diferentes programas de formación.</p>\n	<p><strong>Funciones de la Sala Situacional</strong></p>\n	<p>1. Elevar los atributos de eficiencia, eficacia, y mejorar la calidad, el desempeño y la intervención del MPPE en los espacios sociales e institucionales.</p>\n	<p>2. Articular el cálculo estratégico con el proceso permanente de toma de decisiones</p>\n	<p>3. Análisis matricial:</p>\n	<p>* Articular lo territorial con la democracia social, económica y política.</p>\n	<p>* Planificación y la gestión.</p>\n	<p>* Procesos de “pre alimentación” y retroalimentación”.</p>\n	<p>* Articular el corto plazo con el mediano y largo plazo.</p>\n	<p>4. Disminuir el déficit (Diferencia entre necesidad y oferta de políticas educativas).</p>\n	<p>5. Accionar de manera integrada los diferentes organismos y entes gubernamentales y no-guberntales (Integralidad en la acción).</p>\n	<p>6. Cambiar el modo de gestión y de atención (Basado en evidencias).</p>\n	<p>7. Desarrollar sistemas de seguimiento y evaluación para la rendición de cuentas a la sociedad civil, a través de las fuerzas organizadas en los Consejos Comunales.</p>\n	<p><strong>Estructura Básica:</strong> La sala situacional esta estructurada en tres niveles: nivel estratégico, nivel táctico, nivel operativo.</p>\n	<p><strong>Nivel Estratégico</strong>: Sala se ubica en las instancias superiores de decisiones, reservada a la discusión de nivel superior y para la última decisión en el nivel correspondiente</p>\n	<p><strong>Nivel Táctico</strong>: Sala de comando, que es el centro que controla el sistema en su alimentación, carga permanente y apoyo al funcionamiento de la máquina de análisis y decisión.</p>\n	<p><strong>Nivel Operativo</strong>: Sala de trabajo, información acumulada, capacidad de procesamiento y capacidad de análisis. Puede operar con antelación a la sala “D” a fin de preparar una sesión de la misma, o en paralelo con la sala la sala “T” es permanente y continua.</p>\n	<p><strong>Componentes</strong></p>\n	<p>A) Una infraestructura física: Espacio físico especialmente condicionado para la discusión informada y sistemática.</p>\n	<p>B) Una infraestructura informativa: sistema de información que fluye y se actualiza permanentemente en función de la demanda.</p>\n	<p>C) Una infraestructura computacional: equipos de capacidad, diseños y conexiones adecuadas al tipo de procesamiento y análisis; módems y programas pertinentes al tipo de problemas sobre los cuales versan las decisiones.</p>\n	<p>D) Un equipo humano técnico: Responsable de operar la sala de situaciones articulando los cuatro elementos ya señalados y en interconexión con las unidades regulares del sistema de planificación.</p>\n	<p>E) Una legalidad reconocida: Como parte esencial de la máquina de decisiones, Sala de Situaciones como instancia legitima de “poder decisional” o “poder asesor”.</p>\n<p> </p>', 0, 0),
